import './competence.css'

function Competence() {
    return (
        <section id="competence">
          <h2>Compétences :</h2>
          <ul>
            <li>Langages de programmation : C, Python, JavaScript, HTML, CSS, PHP, SQL</li>
            <li>Framework : React, Node.js,</li>
            <li>Logiciels : Visual Studio Code, Git, GitHub, </li>
            <li>Langues : Français , Anglais (B2)</li>
          </ul>
        </section>
    );
}

export default Competence;
